import React from 'react';
import { Redirect, Route, Switch } from 'react-router-dom';

import { Routes } from '../common/App/App';
import { PartnershipsSearch } from './PartnershipsSearch';

export default function PartnershipsDashboard() {
  return (
    <Switch>
      <Route path={Routes.Partnerships} component={PartnershipsSearch} />
      <Redirect to={Routes.Restaurants} />
    </Switch>
  );
}
